INSERT INTO `v1_9291786a14dcb84aa829c25ddfdefec7cf4cb5ac6e2c7ff266019577ddb416f5` VALUES ("スタンダードコレクション", 1, "スタンダードコレクションではポスターやペナントなど\n部屋に飾れる定番グッズが盛りだくさん！\nあなたの部屋をカルミナで彩ろう！", "1回メダル{0}枚！\n定番グッズであなたの部屋をカルミナで彩ろう！", 1, 3);
INSERT INTO `v1_9291786a14dcb84aa829c25ddfdefec7cf4cb5ac6e2c7ff266019577ddb416f5` VALUES ("プレミアムコレクション", 2, "プレミアムコレクションではサイン色紙や\nブロマイドなど、★★以上のグッズが盛りだくさん！\nレアグッズをたくさんゲットしよう！", "1回メダル{0}枚！\nメンバー直筆サイン色紙など、★★以上のグッズを確定でゲット！", 1, 10);
INSERT INTO `v1_9291786a14dcb84aa829c25ddfdefec7cf4cb5ac6e2c7ff266019577ddb416f5` VALUES ("フェスコレクション", 3, "フェスコレクションではカルミナサマーライブで\n大活躍するグッズが勢ぞろい！\nゲットしたグッズを片手に、いざライブ会場へ！", "1回メダル{0}枚！\nカルミナライブに参加する際のマストアイテムをゲットしよう！", 1, 3);
